I wanted to create something that represented and captured the visceral remembering of who we are and where we come from. Not just our city but our continent, not just our continent but our place in the universe. My inspiration was to create images for my 3 children to see in our home everyday and for it to become a reminder of their authentic Power of creation. So that they can identify with something more than a public image. Especially in these so called modern times of people of color being murdered by those under the banner of power backed by laws created by white men. Somebody lied to us. Think of how different things would be if colorful Black and Brown boys and girls grew up seeing and knowing our peoples wealth of contribution intellectually and physically beginning with the birth of humanity continued onto every civilization and culture there after. Take a minute to wonder If they are taught at home and school to learn of the spirit that lives within them which is the same energy that was put into the trybe, family, community, agriculture, architecture, art, dance, mathematics, geometry, algebra, astronomy, natural medicine, science, technology, honoring life and death and just straight up civilization from its inception. Now imagine those same little colorful kids knowing the inherent sovereignty that they and their ancestors have had upon the entire world for tens of thousands of millennia, till this day. Could you imagine knowing the power of not ever being owned? Black history is more than American, it‚Äôs world history. Just food for thought. If you have read this far you are a real one or close to it.

